// client/src/components/AdminPanel.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';

const AdminPanel = () => {
  const [coupons, setCoupons] = useState([]);

  useEffect(() => {
    const fetchCoupons = async () => {
      try {
        const res = await axios.get('http://localhost:5000/api/coupons');
        setCoupons(res.data);
      } catch (err) {
        console.error(err.response ? err.response.data : err.message);
      }
    };
    fetchCoupons();
  }, []);

  return (
    <div>
      <h2>Admin Panel</h2>
      <table border="1" cellPadding="8">
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Mobile Number</th>
            <th>Flat Number</th>
            <th>Expiration</th>
            <th>Used</th>
            <th>Created At</th>
          </tr>
        </thead>
        <tbody>
          {coupons.map(coupon => (
            <tr key={coupon._id}>
              <td>{coupon._id}</td>
              <td>{coupon.name}</td>
              <td>{coupon.mobileNumber}</td>
              <td>{coupon.flatNumber}</td>
              <td>{new Date(coupon.expireAt).toLocaleString()}</td>
              <td>{coupon.used ? 'Yes' : 'No'}</td>
              <td>{new Date(coupon.createdAt).toLocaleString()}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default AdminPanel;
